import React from 'react';

function Header() {
  return (
    <header>
      <div className="header-logo">
        <p>Athul Thampan</p>
      </div>
      {/* Adding a container for the navigation links */}
      <div className="navbar">
        <a className="header-links" href="https://drive.google.com/file/d/1YV-ZF9GMg3sgkAhg_tbW_JnfM7ZpieSl/view?usp=sharing" target="_blank" rel="noopener noreferrer">Resume</a>
        <a className="header-links" href="#aboutme">About me</a>
        <a className="header-links" href="#projects">Projects</a>
        <a className="header-links" href="#contact">Contact</a>
      </div>
    </header>
  );
}

export default Header;
